import React, {Component} from 'react';
import axios from 'axios';

class Konto extends Component {
    constructor(props){
        super(props);
        this.state = {
            data : null,
        };
    }
dateClick() {
    var bodyFormData = new FormData();
    bodyFormData.append('idPrac', 1);
    bodyFormData.append('rod', 'magazyn');
    bodyFormData.append('idRod', 2);
    bodyFormData.append('typ', "update");
    bodyFormData.append('dat', new Date());

    axios({
        method: 'post',
        url: 'http://localhost:8081/history/add',
        data: bodyFormData
    }) .then((response) => {
        this.setState({doks: response.data})
    }).catch((error) => {
        console.log(error)
    });
}

    render() {
        return (
            <div className="data-in-page">
                {localStorage.getItem('loginfo')}
                <p onClick={() => this.dateClick()}>click</p>
                {this.state.data}
            </div>
        );
    }
}

export default Konto;
